# S5.1.2 RASA3 

RASA3 inactivation is not well known experimentally, so for now we will treat it as a mass-action binding between RASA3 and $\mathrm{PIP}_{3}$.

![table_6](table_6)

Tab. S5: Parameter values associated with RASA3. At time $t=0 \mathrm{~s}$ in the steady-state simulation, $[\mathrm{RASA} 3]_{S}=N^{\mathrm{RASA} 3} / S_{\mathrm{PM}}$ and all other states are initialized to 0 .

$$
\begin{aligned}
S_{\mathrm{PM}} \frac{d}{d t}[\mathrm{RASA} 3]_{S} & =\underbrace{S_{\mathrm{PM}} k_{-\mathrm{PIP}_{3}}^{\mathrm{RASA} 3}\left[\mathrm{RASA} 3-\mathrm{PIP}_{3}\right]_{S}-S_{\mathrm{PM}}\left(\frac{S_{\mathrm{PM}}}{V_{\mathrm{cyt}}} k_{\mathrm{PIP}_{3}}^{\mathrm{RASA} 3}\right)\left[\mathrm{RASA} 3\right]_{S}\left[\mathrm{PIP}_{3}\right]_{S}}_{\mathrm{PIP}_{3} \text { inactivation of RASA3 }} \\
S_{\mathrm{PM}} \frac{d}{d t}\left[\mathrm{RASA} 3-\mathrm{PIP}_{3}\right]_{S} & =\underbrace{-S_{\mathrm{PM}} k_{-\mathrm{PIP}_{3}}^{\mathrm{RASA} 3}\left[\mathrm{RASA} 3-\mathrm{PIP}_{3}\right]_{S}+S_{\mathrm{PM}}\left(\frac{S_{\mathrm{PM}}}{V_{\mathrm{cyt}}} k_{\mathrm{PIP}_{3}}^{\mathrm{RASA} 3}\right)\left[\mathrm{RASA} 3\right]_{S}\left[\mathrm{PIP}_{3}\right]_{S}}_{\mathrm{PIP}_{3} \text { inactivation of RASA3 }}
\end{aligned}
$$
